import styles from './topNavigationBar.css';
import React  from 'react';
import { Link ,Outlet } from 'react-router-dom';


class course extends React.Component {
    constructor(props) {
        super(props);
    }
    
    render() {
        return (
            <div>
                <div className="menu">
                    <Link>课程管理</Link>
                    <Link>资源管理</Link>
                </div>
    
                <div>
                    <h3>课程管理</h3>
                    
                </div>
            </div>
        )
    }
}

export default course;
